pragma solidity ^0.4.24;

interface IInvokeOracle{
    function requestData(address _caller) external returns (bytes32 requestId);
    function depositPLI(uint256 _values) external returns(bool);
    function showPrice() external returns(uint256);
}

contract IntegrationSample{

    address CONTRACTADDR = 0x1a8D6F587456b5b28e9f76D53fC38545E184D381;
    bytes32 public requestId; 
    uint128 public timestampOflatestPrice; 

    function getPriceInfo() external returns(uint256){
        (requestId) = IInvokeOracle(CONTRACTADDR).requestData({_caller:msg.sender}); 
        uint256 _value = IInvokeOracle(CONTRACTADDR).showPrice();
        return _value;
    }
}
